      axios({
    method:"get",
    url:"http://localhost:5000/api/allassets"
    }).then((response)=>{
    console.log("response from all cake api",response.data)
    setVideo(response.data.videos)
    console.log("video",video?.length)
      },(error)=>{
    console.log("Error from all cake api",error)
 })
 },[])




